import "./coin.css";

function CoinItem() {
  return (
    <div className="coin">
      <p>1</p>
      <p className="symbol">
        <img src="" alt="coin" />
        <span>btc</span>
      </p>
      <p>$25000</p>
      <p>+3%</p>
      <p className="hide-mobile">3b</p>
      <p className="hide-mobile">soem</p>
    </div>
  );
}

export default CoinItem;
